\begin{align*}
\mathbf{a} \times \mathbf{j} &= -(\mathbf{a}_x \mathbf{k} - \mathbf{a}_z \mathbf{i}) \\
\|\mathbf{a} \times \mathbf{j}\|^2 &= (-\mathbf{a}_x)^2 + (-\mathbf{a}_z)^2 = \mathbf{a}_x^2 + \mathbf{a}_z^2
\end{align*}

and:
\begin{align*}
\mathbf{a} \times \mathbf{k} &= (\mathbf{a}_x \mathbf{j} - \mathbf{a}_y \mathbf{i}) \\
\|\mathbf{a} \times \mathbf{k}\|^2 &= (\mathbf{a}_x)^2 + (-\mathbf{a}_y)^2 = \mathbf{a}_x^2 + \mathbf{a}_y^2
\end{align*}

Now we can add the three results together:
\begin{align*}
\|\mathbf{a} \times \mathbf{i}\|^2 + \|\mathbf{a} \times \mathbf{j}\|^2 + \|\mathbf{a} \times \mathbf{k}\|^2
= (\mathbf{a}_y^2 + \mathbf{a}_z^2) + (\mathbf{a}_x^2 + \mathbf{a}_z^2) + (\mathbf{a}_x^2 + \mathbf{a}_y^2)
\end{align*}

Factoring out a 2 from each pair of terms we have:
