Step 2:  First, let's consider the formula for the area of a circle, which is $\pi r^2,$ where $r$ is the radius. We're also given that the area of the shaded region is $20\%$ of the area of the circle.
Step 3:  Since the area of the shaded region is $20\%$ of the entire circle, we can find the ratio of the area of the shaded region to the area of the entire circle. This is $\frac{1}{5}$ as $20\% = \frac{20}{100} = \frac{1}{5}.$
Step 4:  The area of a sector of a circle is given by $\frac{\theta}{360} \pi r^2,$ where $\theta$ is the central angle in degrees of the sector, and $r$ is the radius. In this case, since the area of the shaded region is $\frac{1}{5}$ of the total area, we have $\frac{\frac{\theta}{360} \pi r^2}{\pi r^2} = \frac{1}{5}.$
Step 5:  Simplifying this equation, we can see that $\frac{\theta}{360} = \frac{1}{5}.$ Solving for $\theta,$ we find that $\theta = 72^{\circ}.$
Step 6:  Given that the central angle of the sector is $72^{\circ},$ we want to find the central angle of the given sector in the problem, let's call it $x.$ We need to find a relationship between the angles.
Step 7:  To do this, let's look at an angle of $360^{\circ} - 72^{\circ} = 288^{\circ}.$ We can divide this by $8$ to get an angle measure of $\frac{288^{\circ}}{8} = 36^{\circ}$ for each of these eight sectors.
Step 8:  Therefore, each sector covers an angle of $36^{\circ},$ so the angle $x$ can be obtained by subtracting $36^{\circ}$ from $360^{\circ}.$
